import { collection, getDocs, getFirestore } from "firebase/firestore"
import { useState, useEffect } from "react"
import firebaseConfig from "../../services/config/firebase";
import { Container, ContainerSemana, Semanas, TileSemana, SubTitles, HR, Data } from './styles'
// https://www.youtube.com/watch?v=gqbXnYhvB5E&t=264s

const ListUsers = () => {

  const [users, setUsers] = useState([])
  const db = getFirestore(firebaseConfig)
  const usersCollectionRef = collection(db, "users")

  // trás todos os dados que estão cadastrados no banco
  useEffect(() => {
    const getUsers = async () => {
      const data = await getDocs(usersCollectionRef)
      const usersCadastrados = (data.docs.map((doc) => ({ ...doc.data(), id: doc.id })))
      setUsers(usersCadastrados)
    }
    getUsers()
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, [])

  return (
    <Container>
      <ContainerSemana>
        <Semanas>
          <TileSemana>Domingo</TileSemana>
          <SubTitles>
            <p className="Name">Nome</p>
            <p className="birthdate">Data Nasc.</p>
          </SubTitles>
          <HR> __________________________________________ </HR>
          <Data>
            <div className="ContainerName">
              <ul>
                {users.map(users => {
                  return (
                    <li>
                      {users.name}
                    </li>
                  )
                })}
              </ul>
            </div>
            <div className="ContainerBirthdate">
              <ul>
                {users.map(users => {
                  return (
                    <li>
                      {users.birthDate}
                    </li>
                  )
                })}
              </ul>
            </div>
          </Data>
        </Semanas>
        <Semanas>
          <TileSemana>Segunga-Feira</TileSemana>
          <SubTitles>
            <p className="Name">Nome</p>
            <p className="birthdate">Data Nasc.</p>
          </SubTitles>
          <HR> __________________________________________ </HR>
          <Data>
            <div className="ContainerName">
              <ul>
                {users.map(users => {
                  return (
                    <li>
                      {users.name}
                    </li>
                  )
                })}
              </ul>
            </div>
            <div className="ContainerBirthdate">
              <ul>
                {users.map(users => {
                  return (
                    <li>
                      {users.birthDate}
                    </li>
                  )
                })}
              </ul>
            </div>
          </Data>
        </Semanas>
        <Semanas>
          <TileSemana>Terça-Feira</TileSemana>
          <SubTitles>
            <p className="Name">Nome</p>
            <p className="birthdate">Data Nasc.</p>
          </SubTitles>
          <HR> __________________________________________ </HR>
          <Data>
            <div className="ContainerName">
              <ul>
                {users.map(users => {
                  return (
                    <li>
                      {users.name}
                    </li>
                  )
                })}
              </ul>
            </div>
            <div className="ContainerBirthdate">
              <ul>
                {users.map(users => {
                  return (
                    <li>
                      {users.birthDate}
                    </li>
                  )
                })}
              </ul>
            </div>
          </Data>
        </Semanas>
